    {/* Emp Mngmt App using CRUD */}   <img src="{emp}" alt="emp" className="wrkimg"/> 
    {/* Instagram Clone App */}   <img src="" alt="" className="wrkimg"/>
    {/* Budget Management App */}   <img src="" alt="" className="wrkimg"/>
            
                </div>
            </div>
        </section>
    );
}

